INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('07a8d722-9b85-4130-83fd-c1c0d150ba33', 'chuatecuanhungchiecnhan', 'Chúa Tể Của Những Chiếc Nhẫn', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401294772.jpg', '120', 'Chương cuối cùng của loạt phim Chúa Tể Của Những Chiếc Nhẫn mang tới trận chiến cuối cùng giữa thiện và ác cùng tương lai của Trung Địa.', 'Peter Jackson', 'Elijah Wood, Viggo Mortensen, Ian McKellen', 'TIENG ANH', '2023-11-29 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm01', '2023-12-12 12:40:28', '2023-12-13 00:14:54');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('0cc1b24f-61d8-4d98-8212-7461cfc8daa7', 'marvels', 'The Marvels', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401501107.jpg', '110', 'Carol Danvers bị vướng vào sức mạnh của Kamala Khan và Monica Rambeau, buộc họ phải hợp tác với nhau để cứu vũ trụ.', 'Nia DaCosta', 'Brie Larson, Samuel L. Jackson, Zawe Ashton', 'TIENG ANH', '2023-11-25 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm01', '2023-12-12 12:31:41', '2023-12-13 00:18:21');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('1295c396-06a4-451c-a76c-0bd919f47966', 'vonglapquydu', 'Vòng Lặp Quỷ Dữ', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401541415.jpg', '110', 'Hao, với khả năng nhìn thấy những sự kiện quá khứ, đã cứu Sari khỏi cơn thịnh nộ của Pocong Gundul, một phù thủy độc ác. Trong lúc trốn khỏi sự tấn công của Pocong Gundul, Hao đã sử dụng sức mạnh của mình đào sâu quá khứ và phát hiện bí mật của hắn', 'Awi Suryadi', 'Deva Mahenra, Della Dartyan, Nayla D. Purnama, Iwa K', 'TIENG VIET', '2023-12-15 00:00:00', '2023-12-30 00:00:00', 'Hoạt động', 'tm04', '2023-12-12 12:53:42', '2023-12-13 00:19:01');
