INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('2c7f1488-a699-4676-940a-0d62c2498169', 'aquaman', 'Aquaman Và Vương Quốc Thất Lạc', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401128566.jpg', '120', 'Momoa trong vai Aquaman—cùng với Patrick Wilson, Amber Heard, Yahya Abdul-Mateen II và Nicole Kidman sẽ trở lại trong phần tiếp theo của bộ phim “Aquaman Và Vương Quốc Thất Lạc"', 'James Wan', 'Jason Momoa, Ben Affleck, Patrick Wilson', 'TIENG ANH', '2023-12-20 00:00:00', '2024-01-10 00:00:00', 'Hoạt động', 'tm01', '2023-12-12 13:06:44', '2023-12-13 00:12:08');
