INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('3f1803df-a786-4fca-b505-3eda1b56106c', 'amhonsiam', 'Âm Hồn SIAM', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401107281.jpg', '90', 'Bộ phim kể về mối tình tay ba của hai người bạn thân cùng phải lòng một chàng trai, nhưng cuối cùng chuyện tình này lại động chạm đến ma thuật hắc ám.', 'Jetniphut Sa-Shing', 'Ying Ariya Buakong, Lura Chansri, Chutiya Jiarakul', 'TIENG ANH', '2023-11-25 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm04', '2023-12-12 12:36:52', '2023-12-13 00:11:47');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('6933a264-9073-4ccb-a529-a60b8ecf2a24', 'yeulaivongau', 'Yêu Lại Vợ Ngầu', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401582960.jpg', '120', 'Cặp vợ chồng trẻ No Jung Yeol (Kang Ha-neul) và Hong Na Ra (Jung So-min) từ cuộc sống hôn nhân màu hồng dần “hiện nguyên hình” trở thành cái gai trong mắt đối phương với vô vàn thói hư, tật xấu', 'Nam Dae-jung', 'Kang Ha-neul, Jung So-min, Kim Sun-young, Lim Chul-hyung', 'TIENG VIET', '2023-11-20 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm02', '2023-12-12 12:51:15', '2023-12-13 00:19:42');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('6a49a3b2-ef51-4d67-901e-1fb46766c66d', 'quylun', 'Quỷ Lùn Tinh Nghịch', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401689307.jpg', '100', 'Sự xuất hiện đột ngột của John Dory, anh trai thất lạc đã lâu của Branch mở ra quá khứ bí mật được che giấu bấy lâu nay của Branch. Đó là quá khứ về một ban nhạc có tên BroZone từng rất nổi tiếng nhưng đã tan rã', 'Walt Dohrn, Tim Heitz', 'Anna Kendrick, Zooey Deschanel, Justin Timberlake', 'TIENG ANH', '2023-11-15 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm03', '2023-12-07 21:01:46', '2023-12-13 00:21:29');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('79703f1a-72c6-4bd4-bc0f-9399213ec764', 'thieunienvachimdiec', 'Thiếu Niên Và Chim Diệc', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401512077.jpg', '125', 'Đến từ Studio Ghibli và đạo diễn Miyazaki Hayao, bộ phim là câu chuyện về hành trình kỳ diệu của cậu thiếu niên Mahito trong một thế giới hoàn toàn mới lạ', 'Miyazaki Hayao', 'Santoki Soma, Suda Masaki, Shibasaki Ko', 'NHAT BAN', '2023-12-16 00:00:00', '2023-12-30 00:00:00', 'Hoạt động', 'tm03', '2023-12-12 13:02:00', '2023-12-13 00:18:32');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('82df5e61-7f38-479b-b4a8-ed58377c0361', 'decheNapoleon', 'Đế Chế NAPOLEON', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401646236.jpg', '140', 'Bộ phim là cái nhìn nguyên bản và cá nhân về nguồn gốc của Napoléon Bonaparte và quá trình leo lên ngôi hoàng đế nhanh chóng, tàn nhẫn của ông', 'Ridley Scott', 'Vanessa Kirby, Joaquin Phoenix, Ludivine Sagnier', 'TIENG ANH', '2023-12-05 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm01', '2023-12-07 20:57:41', '2023-12-13 00:20:46');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('87d3b0fa-1c8d-4246-8bef-3566c7a1322a', 'joker-01', 'The Dark Knight - Joker', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401484591.jpg', '120', 'hành động, tội phạm', 'Todd Phillips', 'Joaquin Phoenix', 'TIENG ANH', '2023-11-25 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm01', '2023-11-28 10:23:45', '2023-12-13 00:18:04');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('9cff116f-04fd-48b9-8b72-1324caff712b', 'nhavitdicu', 'Nhà Vịt Di Cư', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401407009.jpg', '120', 'Nhà Vịt Di Cư theo chân một gia đình vịt trời gồm vịt bố, vịt mẹ, cậu con trai tuổi teen Dax và vịt út Gwen, trong lần đầu tiên trải nghiệm chuyến di cư tiến về phía nam để trú đông', 'Benjamin Renner', 'Kumail Nanjiani, Elizabeth Banks, Caspar Jennings, Tresi Gazal, Awkwafina', 'TIENG ANH', '2023-12-23 00:00:00', '2024-01-30 00:00:00', 'Hoạt động', 'tm03', '2023-12-12 12:56:21', '2023-12-13 10:33:25');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('c28d32fc-84d4-49a2-86b3-9764c173b6cd', 'tienvong', 'Tiễn Vong', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401525485.jpg', '120', 'Sẽ ra sao khi người yếu bóng vía trở thành “hậu duệ” nghề mai táng Joed sau khi tốt nghiệp trường Luật bỗng nhận hung tin rằng người cha của anh mắc bệnh nan y cũng là lúc anh đối diện với nỗi ám ảnh kế nghiệp nghề gia truyền', 'THITI SRINUAN', 'CHATCHAI CHINNASRI , SUTIDA BUATIK , NARUEPOL YAIIM', 'TIENG VIET', '2023-12-16 00:00:00', '2023-12-30 00:00:00', 'Hoạt động', 'tm04', '2023-12-12 13:04:02', '2023-12-13 00:18:45');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('d5751dc5-430b-42bc-a352-0c660f72d047', 'dieuuoc', 'Điều Ước', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401335905.jpg', '95', '"Điều Ước" lấy bối cảnh tại một vương quốc diệu kỳ tên Rosas. Ở đây, Asha - một cô gái thông minh và mơ mộng đã ước một điều ước quá sức mạnh mẽ, đến nỗi một thế lực ngoài vũ trụ với sức mạnh vô hạn tên Star đã đáp lại cô', 'Chris Buck (Frozen & Frozen 2), Fawn Veerasunthorn', 'Ariana DeBose, Chris Pine, Alan Tudyk', 'TIENG ANH', '2023-11-24 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm03', '2023-12-12 12:47:54', '2023-12-13 00:15:35');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('d5a954ce-8150-444b-90f7-f819ba6fcc64', 'cauhon', 'Cầu Hồn', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401192594.jpg', '100', 'Cầu Hồn bắt đầu trong bối cảnh kỳ lạ của những câu chuyện siêu nhiên được lưu hành trong trường.', 'Lester Hsi', 'Ning Chang, J.C Lin, Summer Meng', 'TRUNG QUOC', '2023-11-17 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm04', '2023-12-12 12:34:07', '2023-12-13 00:13:12');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('db8cef62-1a5e-4d94-aac0-7d1d4f6b331b', 'chiemdoat', 'Chiếm Đoạt', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401390081.jpg', '115', 'Kể về người vợ của một gia đình thượng lưu thuê cô bảo mẫu “trong mơ” để chăm sóc con trai mình. Nhưng cô không ngờ rằng, phía sau sự trong sáng, tinh khiết kia, cô bảo mẫu luôn che giấu âm mưu nhằm phá hoại hạnh phúc gia đình', 'Thắng Vũ', 'Miu Lê, Lãnh Thanh, Karik, Phương Anh Đào', 'TIENG VIET', '2023-11-24 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm01', '2023-12-12 12:45:55', '2023-12-13 00:16:30');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('f9e9adfd-0b54-4843-bfe0-3d446aa89c79', 'nguoimattroi', 'Người Mặt Trời', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401662376.jpg', '115', '400 năm qua, loài Ma Cà Rồng đã bí mật sống giữa loài người trong hòa bình, nhưng hiểm họa bỗng ập đến khi một cô gái loài người phát hiện được thân phận của hai anh em Ma Cà Rồng', 'Timothy Linh Bui', 'Chi Pu, Thuận Nguyễn, Trần Ngọc Vàng, Trịnh Thảo', 'TIENG VIET', '2023-12-05 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm01', '2023-12-07 20:46:32', '2023-12-13 00:21:02');
INSERT INTO cineza.Movie (id, code, movieName, moviePoster, movieTime, description, director, actor, language, startDate, endDate, status, movieType, createdAt, updatedAt) VALUES ('fc4adbaa-ee16-46ce-ac2a-6e7452ede623', 'wonka', 'WONKA', 'http://47.128.146.135:9000/src\\public\\img\\poster_1702401705218.jpg', '120', 'WONKA kể câu chuyện kỳ diệu về hành trình của nhà phát minh, ảo thuật gia và nhà sản xuất sôcôla vĩ đại nhất thế giới trở thành WILLY WONKA đáng yêu mà chúng ta biết ngày nay', 'Paul King', 'Timothée Chalamet, Hugh Grant', 'TIENG ANH', '2023-12-05 00:00:00', '2023-12-20 00:00:00', 'Hoạt động', 'tm02', '2023-12-07 20:40:59', '2023-12-13 00:21:45');
